import Nav from './Nav';
import { authenticationService } from '../_services';

const Layout = ({ children }) => (
  <div className="layout">
    <header>
      <Nav currentUser={authenticationService.currentUserValue} />
    </header>
    <main>
      {children}
    </main>
  </div>
);

export default Layout;
